webpackJsonp([0x730e479d2ac6],{706:function(a,e){a.exports={data:{markdownRemark:{html:'<h2 id="wanna-be-evaluatordeveloper-contact-me"><a href="#wanna-be-evaluatordeveloper-contact-me" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Wanna be evaluator/developer? contact me!</h2>\n<h2 id="kumlaude"><a href="#kumlaude" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Kumlaude?</h2>\n<blockquote>\n<p>Kumlaude adalah project open source untuk mahasiswa ilmu komputer ugm, berisi materi-materi belajar yang bersangkutan dengan ilmu komputer. Website dari repo ini adalah <a href="https://fajarnuha.github.io/kumlaude">https://fajarnuha.github.io/kumlaude</a></p>\n</blockquote>\n<hr>\n<h2 id="konten"><a href="#konten" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Konten</h2>\n<p>Semua konten-konten disini adalah hasil kolaborasi penulisan mahasiswa-mahasiswa ilmu komputer. Semua orang bisa mengajukan usulan penulisan dengan pull-request(PR), dan akan di review oleh maintainer repository ini, jika kiranya bermanfaat, usulan akan diterima dan di publish ke website Kumlaude</p>\n<p>Konten bisa berisi tulisan, gambar, links, video, tips-trick, review dosen, info ujian, code, atau apapun asal bermanfaat</p>\n<p>Konten tidak harus yang panjang dan ribet. Hanya 1-2 baris boleh asalkan bermanfaat. Tidak usah takut salah, project ini open source, jadi kalau salah ntar akan ada orang yang benerin</p>\n<p>Kamu boleh nambah tulisan di artikel yang sudah ada, atau bisa juga buat konten/folder/topic jika belum ada. Tinggal PR aja!</p>\n<hr>\n<h2 id="siapa-saja-yang-berkolaborasi-disini"><a href="#siapa-saja-yang-berkolaborasi-disini" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Siapa saja yang berkolaborasi disini?</h2>\n<p>Semua orang, tapi ada 4 kategori orang di project ini:</p>\n<ol>\n<li>User : semua mahasiswa ilmu komputer yang ingin belajar biar cumlaude</li>\n<li>Content Contributor : semua mahasiswa yang menulis hal yg bermanfaat disini</li>\n<li>Code Contributor : mahasiswa yang membuat website ini berjalan dan beraparas lebih keren</li>\n<li>Maintainers : mahasiswa yang mengevaluasi PR dan maintain website</li>\n</ol>\n<hr>\n<h2 id="cara-kontribusi-konten"><a href="#cara-kontribusi-konten" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Cara Kontribusi Konten</h2>\n<p>Konten-konten di kumlaude, termasuk guide ini, berupa file-file <a href="https://en.wikipedia.org/wiki/Markdown">markdown</a> yang notabene mirip txt biasa tp lebih canggih.</p>\n<p>Jadi belajar trik-trik markdown dulu biar kontennya makin apik. <a href="https://github.com/adam-p/markdown-here/wiki/Markdown-Cheatsheet#lists">Markdown Cheatsheet</a></p>\n<p>Sebelumnya, kalau kamu ini di website, pergi dulu ke <a href="http://github.com/fajarnuha/kumlaude">Github</a> nya</p>\n<p>Ada 2 cara kontribusi:<br>\n<strong>Gampang</strong></p>\n<ol>\n<li>Pergi ke <code class="language-text">content/colab</code> di repo kumlaude, cari artikel yang ingin ditulis atau diedit. Biasanya nama filenya index.md di tiap topic folder</li>\n<li>Click icon pensil "Edit this file" dan buat changes dalam file di Github-flavored Markdown</li>\n<li>Scroll kebawah dan tambahkan commit message yang menerangkan changes kamu. Kemudian pilih "Create a new branch for this commit and start a pull-request", kemudian pilih "Propose file changes"</li>\n<li>Kemudian, kamu bisa tambahkan detail lainnya, lalu "Create pull request"\n<br><br></li>\n</ol>\n<p><a href="https://i.imgur.com/0cmxJwN.gif"><img src="https://i.imgur.com/0cmxJwN.gif" alt="Gif contoh dari project serupa freeCodeCamp"></a></p>\n<p><strong>Developer Way</strong></p>\n<ol>\n<li>Fork repo</li>\n<li>clone repo ke local dengan command <code class="language-text">git clone https://github.com/YOUR-GITHUB-USERNAME/kumlaude.git</code></li>\n<li>Tambah remote upstream <code class="language-text">git remote add upstream https://github.com/fajarnuha/kumlaude.git</code></li>\n<li>Buat branch baru untuk kerjaanmu dengan <code class="language-text">git checkout -b NEW-BRANCH-NAME</code>. Kasih nama yang logis</li>\n<li>Commit changes di lokal dulu dengan <code class="language-text">git commit -m &quot;SHORT MESSAGE&quot;</code>. Push ke remote <code class="language-text">git push origin NEW-BRANCH-NAME</code></li>\n<li>Ke repo kamu di Github terus open PR</li>\n<li>Lihat <a href="https://github.com/fajarnuha/kumlaude/issues">issues</a> di Github jika ingin contribute code</li>\n</ol>\n<p>more on <a href="https://github.com/Roshanjossey/first-contributions">Pull Request</a></p>\n<hr>\n<h2 id="rewards"><a href="#rewards" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Rewards</h2>\n<blockquote>\n<p>Pahala insyaaAllah, karena ini termasuk amalan <em>ilmu yang bermanfaat</em> (setiap kali dibaca orang lain). Uang ga ada. However, maintainers dan top contributor akan ada di halaman <a href="https://fajarnuha.github.io/kumlaude/about">About</a>. Jadi berlomba-lombalah!</p>\n</blockquote>\n<hr>\n<h2 id="content-style-guide"><a href="#content-style-guide" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Content Style Guide</h2>\n<p><em>masih on progress, jadi belum ada aturan aneh-aneh, yang penting website ini terisi dulu</em></p>\n<p>Supaya pull request kamu diterima, coba perhatikan hal berikut:</p>\n<h3 id="file"><a href="#file" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>File</h3>\n<ol>\n<li>Wajib kasih <code class="language-text">title</code> di markdown </li>\n<li>Nama file adalah <code class="language-text">index.md</code> kecuali di topic notes, which is sesuai notes yg ditulis, eg <code class="language-text">binary-search.md</code></li>\n<li>Taruh gambar cover dengan kasih <code class="language-text">cover</code> di frontmatter (optional, jika kosong gambar akan random)</li>\n</ol>\n<p>contoh <code class="language-text">index.md</code> di folder kalkulus-1 dengan cover</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">---\ntitle: &quot;Calculus 1&quot;\ncover: &quot;http://dennydio.staf.akprind.ac.id/wp/wp-content/uploads/2017/09/images.png&quot;\n---</code></pre>\n      </div>\n<h3 id="folder"><a href="#folder" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Folder</h3>\n<ol>\n<li>Mewakili kategori yang bersangkutan.</li>\n<li>\n<p>Nama folder harus mengikuti skema <code class="language-text">kebab-case</code></p>\n<hr>\n</li>\n</ol>\n<h2 id="developer-guide"><a href="#developer-guide" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Developer Guide</h2>\n<p>You are more than welcome to make this site better/prettier</p>\n<p>In this repo, we learn:</p>\n<ul>\n<li>Gatsby JS</li>\n<li>JS Components</li>\n<li>GraphQL</li>\n<li>Markdown</li>\n<li>SCSS</li>\n<li>Git</li>\n<li>Travis CI</li>\n</ul>',timeToRead:3,excerpt:"Wanna be evaluator/developer? contact me! Kumlaude? Kumlaude adalah project open source untuk mahasiswa ilmu komputer ugm, berisi materi…",frontmatter:{title:"Contribution Guide",cover:"/img/colaboration.jpg"},fields:{nextTitle:"Jaringan Saraf Tiruan",nextSlug:"/jaringan-saraf-tiruan/",prevTitle:"Genetic Algorithms",prevSlug:"/genetic-algorithms/",slug:"/guides/",modifiedTime:"9-6-2018, 1:38"}},allDirectory:null,allFile:null},pathContext:{slug:"/guides/",slugTrim:"guides"}}}});
